import { useState, useEffect } from 'react';
import { connect } from 'nats.ws';

function App() {
  const [nc, setConnection] = useState(undefined);
  const [lastError, setLastError] = useState("");
  const addmsg=(err,msg)=>{
    console.log(msg.subject)
  }
  useEffect(() => {
    if (nc === undefined) {
      const connectToNats = async () => {
        try {
          const natsConnection = await connect({
            servers: "http://localhost:4222"
          });
          setConnection(natsConnection);
          nc.subscribe(">",{callback:addmsg})

        } catch (err) {
          setLastError("Error connecting");
          console.error(err);
        }
      };

      connectToNats();
    }
  }, [nc]);

  const state = nc ? "Connected" : "Not Connected";

  return (
    <div className="App">
      <h1>Kartheek</h1>
      <h1>{state}</h1>
      <h3>{lastError ? lastError : ""}</h3>
    </div>
  );
}

export default App;
